import React from 'react';
import logo from './assets/header-logo-1.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <h1>Welcome to FinMap</h1>
      <header className='head-image'>
        <img src={logo} alt='Finmap Logo' />
      </header>
    </div>
  );
}

export default App;
